    onClickLogout = () =>{
      localStorage.removeItem('token');
      localStorage.removeItem('currentUser');
      localStorage.removeItem('username');
      console.log(localStorage.getItem('token'));
      window.location.reload(1);
     // window.location.assign("http://www.pinusart.com")
    }

  render() {
    
    return (
            <nav className='navbar navbar-expand-md navbar-dark bg-dark'>
                <a className='navbar-brand' href='/'>Home</a>
                <a className='nav-link' href='/add-customer'>Account Details</a>
                <a className='nav-link' href='/login'>Login</a>
                <a style={{fontSize:"25px", position:"absolute", right:"100px"}} className="nav-item nav-link disabled" href="/" >{localStorage.getItem('username')}</a>
                <button style={{color:"blue", position:"absolute", right:"20px"}} className="btn btn-outline-success my-2" onClick={this.onClickLogout}>Logout</button>
            </nav>
    )
  }
}
